narc.Report()
/*---Narc---*/
public class Narc {
	private  List<String> errList = [];
	private def _start;
	private def _context;
	private def _log;
	private def _testRunner;
	private String _currentTestCase = testRunner.testCase.getName()
	private String _currentTestStep = context.getCurrentStep().getName()
	private String _logData = _currentTestCase + '::' + _currentTestStep + ': ';

	public Narc (def start, def context, def log, def testRunner){
		this._start = start;
		this. _context =context;;
		this._log = log;
		this._testRunner = testRunner;
	}

	public void Report() {
		if (!this.errList.isEmpty()) {
			String error;
		  	//add logic here to iterate through the error list and append message
	    		this.errList.each { err->
	    			_log.error(_logData + err)
	    			 if (error == null)
	    			 	error = err + ' '
	    			 else
	    			 	error <<= err + ' ' 
	    			}				
			_start.util.writeTestStepProperty("DataSink", 'Error Message', error);
			_start.util.writeTestStepProperty("DataSink", 'Status', 'FAIL');
			_start.util.enableTestStep("AddResult");
			_start.util.disableTestStep("Transfer Data");
		}
		else {
			_start.util.writeTestStepProperty("DataSink", 'Error Message', '');
		    _start.util.writeTestStepProperty("DataSink", 'Status', 'PASS');
		    _start.util.disableTestStep("AddResult");
		    _start.util.enableTestStep("Transfer Data");
		}
	}
	public void Log(String message){
		log.info(_logData + message);
	}
	public void addError(String message){
		this.errList.add(message)
	}
}

